    public static int lengthOfLongestSubstring(String s) {

        if ("".equals(s)) {
            return 0;
        }

        int len = s.length();

        char[] chars = s.toCharArray();
        int maxLen = 1;
        // 确定步长
        for(int i = 0; i < len; i++) {
            for(int l = 1; l <= len-1; l++) {
                int tmp = 0;
                HashSet<Character> set = new HashSet<>();
                for(int j = i; j <= l; j ++) {
                    //repeat
                    if(set.contains(chars[j])) {
                        break;
                    } else {
                        // not repeat
                        set.add(chars[j]);
                        tmp++;
                    }
                }
                maxLen = Math.max(maxLen, tmp);
            }
        }

        return maxLen;
    }
